import style from "./About.module.css";

const About = () => {
  return (
    <div className={style.about}>
      <h1>Este es mi primer proyecto con REACT</h1>
      <h3>
        Entre a Henry sin mucho conocimiento sobre programacion y me gusta haber
        aprendido lo que se hasta ahora, por ahora este es mi primer proyecto y
        poco a poco ire mejorando
      </h3>
    </div>
  );
};

export default About;
